import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Container, Box } from '@mui/material';

// Import components
import Login from './pages/Login';
import SimpleDashboard from './pages/SimpleDashboard';
import AdminDashboard from './pages/AdminDashboard';
import ProjectCreate from './pages/ProjectCreate';

// Layout wrapper for authenticated routes (simplified without Navbar for now)
const AuthenticatedLayout = ({ children }) => (
  <Container maxWidth="xl" sx={{ mt: 2, mb: 4 }}>
    {children}
  </Container>
);

// Simple protected route component
const ProtectedRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('userInfo') !== null;
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

function App() {
  return (
    <Box className="App">
      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<Login />} />

        {/* Protected routes with layout */}
        <Route path="/" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/dashboard" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/user/dashboard" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/projects/create" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <ProjectCreate />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/projects" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/data-collection" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/verification" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/marketplace" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        <Route path="/reports" element={
          <ProtectedRoute>
            <AuthenticatedLayout>
              <SimpleDashboard />
            </AuthenticatedLayout>
          </ProtectedRoute>
        } />

        {/* Admin routes */}
        <Route path="/admin/dashboard" element={
          <ProtectedRoute>
            <AdminDashboard />
          </ProtectedRoute>
        } />

        {/* Fallback route */}
        <Route path="*" element={<Navigate to="/login" replace />} />
      </Routes>
    </Box>
  );
}

export default App;
